import './style/App.css';


function GetPosts() {
  const comments = fetch('https://jsonplaceholder.typicode.com/comments/?_limit=10')
  .then((response) => {
    return response.json();
  });
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          <GetPosts />
        </p>
      </header>
    </div>
  );
}

export default App;
